In addition to Type definitions and Procedure signatures, Modules are also able to export static (read: unchanging) values. This seemingly simple feature actually addresses the core value add of heavyweight "Dependency Injection" frameworks like Guice, Dagger, or Spring [1] while providing the static compile-time validation that you'd expect of a first-class programming language feature. The below Module API exports a struct containing a simple server config that's fixed (static) throughout the server's lifecycle: Fig 1: # ex1.claro_module_api # Throughout the server's lifetime this configuration won't change.
static SERVER_CONFIG : ServerConfig; alias ServerConfig : struct { server_name: string, port: int, logging: struct { filename: string }, database: struct { host: string, port: int, database_name: string }
} The value itself will be provided by implementing a provider static_<static value name>() -> <static value type>, for example, the following provider implementation reads and parses [2] the config values from a JSON resource [3] file: Fig 2: { "server_name": "My Server", "port": 8080, "logging": { "filename": "server.log" }, "database": { "host": "localhost", "port": 5432, "database_name": "my_database" }
} Fig 3: # ex1-impl.claro
provider static_SERVER_CONFIG() -> ServerConfig { resources::ConfigJSON |> files::readOrPanic(^) |> var parsedConfig: std::ParsedJson<ServerConfig> = fromJson(^); var parsedResult = unwrap(parsedConfig).result; if (parsedResult instanceof ServerConfig) { # Config has correct format and was parsed successfully. return parsedResult; } # ... Invalid Config File Format Handling ...
