extremely undesirable, so any suggestions for a more appropriate syntax are very welcome. And now, a downstream dependent of the Module exporting the SERVER_CONFIG static value can just directly use the value as it was initialized at program startup by the given provider. Fig 4: var config = Config::SERVER_CONFIG;
