An incredibly common pattern in many software projects is parsing command line flags on startup to configure the behavior of a program. For example in backend web services the same service frequently gets reconfigured via flags to run in various different environments (e.g. test/dev/prod). However, in spite of the pattern's universality, most languages seem to ignore the fact and leave Flag parsing as an exercise for the user. This realistically leaves users either running off to download some 3rd-party library or writing some often poorly maintained boilerplate parsing code themselves. Claro aims to provide a lightweight Flag parsing mechanism as a first-class language feature so that you can skip most of the manual toil for such a simple need. Claro's Flags are a special case of Static Values that can be defined and exported by a Module API [1] : Fig 1: # ex1.claro_module_api # Set this flag on the command line.
flag env: string; Then, just like any other Static Value, it can be referenced directly by anyone with a dependency on the defining Module as in the example below: Fig 2: load("//@claro-lang:rules.bzl", "claro_module", "claro_binary") # This module is the one defining the `env` Flag.
claro_module( name = "config", module_api_file = "ex1.claro_module_api", # Notice no srcs are specified as Flags do not require a provider like other Static Values do.
) claro_binary( name = "demo", main_file = "ex1-test.claro", deps = {"Config": ":config"},
) Fig 3: # ex1-test.claro
Config::env |> print("env: \"{^}\""); Output: env: "" Flags are different than general Static Values simply in the way their values are instantiated. Rather than implementing a provider that will be automatically run to instantiate the value, Flags are actually automatically parsed from the command line args passed to the program at runtime. In the example above, the Flag wasn't explicitly set when the program was run, so the value was defaulted to the empty string .

