Claro's Graph Procedures are an inherently concurrent control flow structure, with nodes executing concurrently by definition. Importantly, Graphs are executed on multiple threads using a threadpool, and Claro takes responsibility for this execution being thread safe. As nodes may be executing simultaneously, it would be fundamentally unsafe for any two nodes to share a reference to the same mutable data as nothing would prevent one of the threads from mutating the data while another thread is reading from it. Claro's approach to addressing this is to track mutability in the type system, and to make use of that information to ensure that no two threads ever share mutable state by statically requiring that all Graph procedure arguments and node outputs are deeply immutable. Fig 1: graph function someGraph(mutArg: mut [int]) -> future<SomeRes> { root res <- computeRes(@nodeB, @nodeC); node nodeB <- doNodeBThing(mutArg); node nodeC <- doNodeCThing(mutArg);
} Compilation Errors: guaranteed_data_race_free_EX1_example.claro:1: Illegal Mutable Graph Procedure Arg: As Graph Procedures are multi-threaded by nature, all args must be deeply-immutable in order to guarantee that Graph Procedures are data-race free by construction. Found the mutable type: mut [int] To correct this, consider converting the arg's type to its deeply-immutable variant: [int]
graph function someGraph(mutArg: mut [int]) -> future<SomeRes> { ^^^^^^
guaranteed_data_race_free_EX1_example.claro:3: Invalid type: Found: mut [int] Expected: int node nodeB <- doNodeBThing(mutArg); ^^^^^^
guaranteed_data_race_free_EX1_example.claro:4: Invalid type: Found: mut [int] Expected: int node nodeC <- doNodeCThing(mutArg); ^^^^^^
3 Errors graph TD nodeB --&gt; res nodeC --&gt; res Here, Claro has correctly identified that nodeB and nodeC would be susceptible to creating a data race, and so a compilation error is raised. Additionally, even if there were only a single graph node actually using mutArg, it would still be fundamentally unsafe. Remember that every single node in a graph runs on the Graph Executor, which is backed by a threadpool meaning that passing any arguments to a graph procedure is inherently an act that hands data to another thread. Claro's philosophy of thread safety is to statically prevent sharing mutable state across threads, so this will not be allowed.

