You're able to define a procedure whose "blocking"-ness is generically determined by the type of the first-class procedure arg that the function is called with. Taking inspiration from Rust's Keyword Generics Initiative , a Claro procedure may be declared "Blocking-Generic" with the following syntax: Fig 1: # Explicitly annotate which arg(s) are blocking-generic.
blocking:pred function filter<T>( l: [T], pred: blocking? function<T -> boolean> # <-- Accepting a blocking-generic function arg.
) -> [T] { return [x | x in l where pred(x)];
} Now, with only a single implementation of your filter function, calls may be statically determined to be either a blocking or non-blocking call depending on the type of the passed pred function arg. So now, from within a Graph, you may call this "blocking-generic" function as long as you pass in a non-blocking pred function. Fig 2: graph function deferToBlockingGenericFn(l: [int]) -> future<[int]> { root noopRes <- @defer; # Legal call to non-blocking procedure in Graph. node defer <- filter(l, (x: int) -> boolean { return x > 0; });
} var res <-| deferToBlockingGenericFn([-1, 5, 3, 0, 2]);
print(res); Output: [5, 3, 2] And of course, Claro will statically forbid calls to blocking-generic procedures when a blocking procedure is passed in: Fig 3: graph function deferToBlockingGenericFn(l: [int]) -> future<[int]> { root noopRes <- @defer; # Illegal call to blocking procedure in Graph. node defer <- filter(l, doBlocking);
} blocking function doBlocking(x: int) -> boolean {
$$ var unwrappedGraphRes <-| futures::immediateFuture(x); # <-- Blocking unwrap.
$$ return unwrappedGraphRes > 0;
} Compilation Errors: Graph Function deferToBlockingGenericFn function<[int] -> future<[int]>> has illegal transitive dep on the following blocking procedures []. Blocking is forbidden within a Graph Function in order to avoid deadlocking.
