A service definition on its own doesn't actually provide much utility without endpoint handlers implemented to actually serve up the responses to incoming requests. As we see from the compilation error above, we must define endpoint handlers for the above HttpService by defining an endpoint_handlers block with a Graph Procedure implementation corresponding to each endpoint in the HttpService definition. Note that in the HTTP service definition above, the greeting endpoint includes {name} in the route - this is a "path parameter" that will automatically be parsed from incoming requests and passed along as input to the associated endpoint handler. So, note that the signature of the greeting endpoint handler includes a string arg that will represent the value of the {name} path parameter for each request to that endpoint. Fig 3: HttpService Greeter { genericGreeting: "/genericGreeting", greeting: "/greeting/{name}"
} endpoint_handlers Greeter { graph provider genericGreeting() -> future<HttpResponse> { root httpRes <- http::getOk200HttpResponseForJson(@json); node json <- EndpointHandlerImpls::GENERIC_GREETING; } graph function greeting(name: string) -> future<HttpResponse> { root httpRes <- http::getOk200HttpResponseForJson(@json); node json <- EndpointHandlerImpls::getGreetingForName(name); }
} var greeterServer: HttpServer<Greeter> = http::getBasicHttpServerForPort(8080);
_ = greeterServer; # Not starting the server yet. As you can see, the core implementation logic was factored out into another Module EndpointHandlerImpls. These impls can do anything, including making arbitrary downstream network requests, as long as they are non-blocking. In this case, they'll simply return some simple greeting. Note: the requirement that each endpoint handler implementation be a Graph Procedure is to ensure that the resulting
web service is statically guaranteed to be non-blocking and to ensure that each request is handled off the
request thread so that long-running computations don't interfere with the service's ability to receive and schedule incoming requests. This ties together all of Claro's design decisions to make building fundamentally concurrent web
services a trivial task.

