The first, extremely simple Build-time Metaprogramming example that we'll look at is one way to create and use source code templates at Build time. As a contrived example, imagine that you're writing an HTTP Service's homepage Endpoint Handler where you want to just serve some hardcoded static HTML representing our site's trivial homepage. Of course, you may decide to just directly write out the HTML string inline, but it would probably be more useful to create a separate homepage.html file so that you can get IDE support for your HTML. You could of course depend on homepage.html as a Resource file to read at runtime, but we could also opt to directly embed the file's HTML contents into the source code at Build time so that we don't have to spend any time reading the file while the program is running. To do this, we could make our source file a template with a format string {{HOMEPAGE_HTML}} to be replaced: Fig 1: # ex1.claro.tmpl
provider homepageHtml() -> string { return "{{HOMEPAGE_HTML}}";
}

262.body:
Bazel provides ample tooling for you to write this functionality entirely from scratch, but to make it easier to get up and running, Claro provides an expand_template(...) Bazel macro out of the box. The BUILD file below expands the template by converting the given homepage.html file to a single line with all " escaped and inserting it into the ex1.claro.tmpl: Fig 2: # BUILD
load("@claro-lang//stdlib/utils/expand_template:expand_template.bzl", "expand_template") expand_template( name = "ex1", template = "ex1.claro.tmpl", out = "ex1.claro", substitutions = { # Replace {{HOMEPAGE_HTML}} with the contents of the html file generated below. "HOMEPAGE_HTML": "homepage_single_line.html", },
) # Learn more about genrule at: https://bazel.build/reference/be/general#genrule
genrule( name = "homepage_single_line", srcs = ["homepage.html"], outs = ["homepage_single_line.html"], # Bash script to remove all newlines and escape double-quotes. cmd = "cat $(SRCS) | tr '\\n' ' ' | sed 's/\"/\\\\\"/g' > $(OUTS)",
) And now you end up with a valid Claro source file: Fig 3: # ex1.claro
provider homepageHtml() -> string { return "<!DOCTYPE html> <html lang=\"en\"> <head> <meta charset=\"UTF-8\"> <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"> <title>My Website</title> </head> <body> <h1>Welcome to my website!</h1> <p>This is a very basic homepage.</p> </body> </html>";
}

