The most basic, and also most important form of reuse in Claro codebases will be in the form of multiple Modules sharing a common API. This doesn't require any special syntax or setup whatsoever, once you've defined a valid .claro_module_api file any number of Modules may implement that API. Each claro_module(...) definition simply needs to declare its module_api_file = ... to reference the same exact .claro_module_api file. For example, the following API: Fig 1: # animal.claro_module_api
opaque newtype InternalState newtype State : struct { name: string, internal: InternalState
} implement AnimalSounds::AnimalSounds<State>; Can be implemented multiple times, by more than one Module: Fig 2: # BUILD
load("@claro-lang//:rules.bzl", "claro_module", "claro_binary") claro_module( name = "dog", module_api_file = "animal.claro_module_api", srcs = ["dog.claro"], deps = {"AnimalSounds": ":animal_sounds"}, # `AnimalSounds` is referenced in this Module's API so must be exported. exports = ["AnimalSounds"],
)
claro_module( name = "cat", module_api_file = "animal.claro_module_api", srcs = ["cat.claro"], deps = {"AnimalSounds": ":animal_sounds"}, # `AnimalSounds` is referenced in this Module's API so must be exported. exports = ["AnimalSounds"],
)
# ... In general, the Build targets declared above will be totally sufficient!

