The API definition above declares that any Module implementing the API will export a type that includes a name field, but may configure its own internal state as it wishes. To make this example more compelling, if you read the API closely, however, you may notice that as presently defined there would be no way for any dependent Module to actually interact with this API as defined, because there's no way to instantiate the opaque newtype InternalState [1] . So, to actually make this API useful, implementing Modules would need to somehow explicitly export some Procedure that gives dependents the ability to instantiate the InternalState. You'll notice that care has been taken to make sure that Claro's API syntax is flexible enough to allow for multiple APIs to be conceptually (or in this case, literally) concatenated to create one larger API for a Module to implement. So that's exactly what we'll do here, with each module exporting an additional procedure from its API to act as a "constructor" for its opaque type. Fig 3: # dog_cons.claro_module_api
function create(name: string, isHappy: boolean) -> State; Fig 4: # cat_cons.claro_module_api
function create(name: string, favoriteInsult: string) -> State; Fig 5: # BUILD
load("@claro-lang//:rules.bzl", "claro_module", "claro_binary") ["BUILD", "animal.claro_module_api", "cat_cons.claro_module_api", "dog_cons.claro_module_api"],
) genrule( name = "dog_api", srcs = ["animal.claro_module_api", "dog_cons.claro_module_api"], outs = ["dog.claro_module_api"], cmd = "cat $(SRCS) > $(OUTS)"
)
claro_module( name = "dog", module_api_file = ":dog_api", # Updated to use the API with a constructor. srcs = ["dog.claro"], deps = {"AnimalSounds": ":animal_sounds"}, # `AnimalSounds` is referenced in this Module's API so must be exported. exports = ["AnimalSounds"],
) genrule( name = "cat_api", srcs = ["animal.claro_module_api", "cat_cons.claro_module_api"], outs = ["cat.claro_module_api"], cmd = "cat $(SRCS) > $(OUTS)"
)
claro_module( name = "cat", module_api_file = ":cat_api", # Updated to use the API with a constructor. srcs = ["cat.claro"], deps = {"AnimalSounds": ":animal_sounds"}, # `AnimalSounds` is referenced in this Module's API so must be exported. exports = ["AnimalSounds"],
)
# ... In the future claro_module(...) will accept a list of .claro_module_api files instead of a single file to make this pattern easier to access without having to manually drop down to a genrule(...) to concatenate API files. And now, importantly, multiple Modules implementing the same API can coexist in the same Claro program with no conflict! Fig 6: # BUILD
load("@claro-lang//:rules.bzl", "claro_module", "claro_binary") # ... claro_binary( name = "animals_example", main_file = "animals_example.claro", deps = { "AnimalSounds": ":animal_sounds", "Cat": ":cat", "Dog": ":dog", },
) Fig 7: # animals_example.claro
var animals: [oneof<Cat::State, Dog::State>] = [ Dog::create("Milo", true), Dog::create("Fido", false), Cat::create("Garfield", "This is worse than Monday morning.") ]; for (animal in animals) { print(AnimalSounds::AnimalSounds::makeNoise(animal));
} Output: Woof!
Grrrr...
This is worse than Monday morning. Read more about Dynamic Dispatch if you're confused how the above Contract Procedure call works.

