The very first thing we'll notice is that the vast majority of these targets are duplicated. So, as programmers, our first thought should be to ask how we can factor out the common logic, to avoid repeating ourselves. The below rewritten BUILD file does a much better job of making the similarities between the Cat and Dog modules explicit, and also prevents them from drifting apart accidentally over time. Fig 8: # BUILD
load("@claro-lang//:rules.bzl", "claro_module", "claro_binary") [ # This list-comprehension should feel very reminiscent of Claro's own comprehensions. [ # Generate multiple targets at once by declaring them in a list or some other collection. genrule( name = "{0}_api".format(name), srcs = ["animal.claro_module_api", "{0}_cons.claro_module_api".format(name)], outs = ["{0}.claro_module_api".format(name)], cmd = "cat $(SRCS) > $(OUTS)" ), claro_module( name = name, module_api_file = ":{0}_api".format(name), srcs = srcs, deps = {"AnimalSounds": ":animal_sounds"}, # `AnimalSounds` is referenced in this Module's API so must be exported. exports = ["AnimalSounds"], ) ] for name, srcs in {"dog": ["dog.claro"], "cat": ["cat.claro"]}.items()
]

