Continuing to consider the "Animals" example from the previous section , let's consider a simple refactoring. As a reminder, previously, calls to AnimalSounds::makeNoise(...) produced very simple output: Fig 1: # animals_example.claro
var animals: [oneof<Cat::State, Dog::State>] = [ Dog::create("Milo", true), Dog::create("Fido", false), Cat::create("Garfield", "This is worse than Monday morning.") ]; for (animal in animals) { print(AnimalSounds::AnimalSounds::makeNoise(animal));
} Output: Woof!
Grrrr...
This is worse than Monday morning. As currently defined... Fig 2: # BUILD
load(":animals.bzl", "Animal") Animal(name = "dog", srcs = ["dog.claro"])
Animal(name = "cat", srcs = ["cat.claro"]) ...if we wanted to include the animals' names in the printed lines. We'd have to go and manually update each Module's implementation, making changes to both dog.claro and cat.claro (and importantly, to any other animals we'd want to share this updated behavior): Fig 3: # cat.claro
newtype InternalState : struct { favoriteInsult: string } implement AnimalSounds::AnimalSounds<State> { function makeNoise(cat: State) -> string { # Cats are mean, they're going to say mean things no matter what. var noise = unwrap(unwrap(cat).internal).favoriteInsult; return "{noise} - says {unwrap(cat).name}"; # Analogous code repeated in dog.claro. }
}
$$
$$function create(name: string, favoriteInsult: string) -> State {
$$ return State({
$$ name = name,
$$ internal = InternalState({favoriteInsult = favoriteInsult})
$$ });
$$} And now, after making the changes, rerunning will give us the updated output we were looking for: Fig 4: Woof! - says Milo
Grrrr... - says Fido
This is worse than Monday morning. - says Garfield Repetition may be ok in some situations, but in many others, it would represent a risk of potential maintenance costs. Of course, you could always factor out the common logic into a new Module that can be depended on and called explicitly by each animal implementation (and in fact, this is absolutely the recommended approach in most situations ). But, since we're interested in digging into possible Build time metaprogramming capabilities in this section, by way of example, we'll walk through some other ways you could go about sharing this base implementation across Modules that potentially wouldn't have been immediately obvious, coming from other languages.

