The first thing to understand is that a Module's implementation can be spread across multiple source files . This means that different .claro files can satisfy different portions of a Module's API. And, more importantly for our current purposes, this means that instead of creating a whole new Module to contain the common logic factored out of dog.claro and cat.claro, we could instead define a single new file containing that factored out logic... Fig 5: # get_message_with_name.claro
function getMessageWithName(message: string, state: State) -> string { var name = unwrap(state).name; # All animal States have a top-level `name` field. return "{message} - says {name}";
} ...include it in the srcs of BOTH Module declarations... Fig 6: # BUILD
load(":animals.bzl", "Animal") # An example of **LITERALLY** reusing code.
Animal(name = "dog", srcs = ["dog.claro", "get_message_with_name.claro"])
Animal(name = "cat", srcs = ["cat.claro", "get_message_with_name.claro"]) ...and then directly call the factored out function in each Module's implementation! Fig 7: # cat.claro
$$newtype InternalState : struct { favoriteInsult: string }
$$
implement AnimalSounds::AnimalSounds<State> { function makeNoise(cat: State) -> string { var noise = unwrap(unwrap(cat).internal).favoriteInsult; return getMessageWithName(noise, cat); # Analogous code repeated in dog.claro. }
}
$$
$$function create(name: string, favoriteInsult: string) -> State {
$$ return State({
$$ name = name,
$$ internal = InternalState({favoriteInsult = favoriteInsult})
$$ });
$$} This is an example of LITERAL code reuse - something that's generally not actually possible in other languages. In fact, you could take this a step further by factoring out this shared src file directly into the Animal(...) Macro implementation to automatically make the getMessageWithName(...) function available to all Animal(...) declarations. The key to this all working is that when the reused function references the State Type, it refers to either Dog::State or Cat::State depending on the context in which it's compiled. And the only field accessed via unwrap(state).name is valid for both types. In a sense, this form of Build time metaprogramming has given this strongly, statically typed programming language the ability to drop down into dynamic "duck typing" features when it's convenient to us. This utterly blurs the lines between the two typing paradigms while still maintaining all of the static type validations because all of this is happening at Build time, with Compile time's type-checking validations still to follow!

