The prior example is a demonstration of the "composition" model where, in order to share code, you explicitly compose new code around the shared code by manually calling into the shared code. But, of course, while composition is generally recommended over the inverted "inheritance" model, many people prefer the convenience that inheritance-based designs offer. Specifically, as you saw in the prior example, composition is more verbose, as you have to explicitly opt in to code sharing, whereas inheritance makes this implicit . Now, instead of each Module implementing the AnimalSounds Contract manually, a single default implementation could be written... Fig 8: # default_animal_sounds_impl.claro
implement AnimalSounds::AnimalSounds<State> { function makeNoise(state: State) -> string { return "{makeNoiseImpl(state)} - says {unwrap(state).name}"; }
} ...and then each Animal Module simply needs to define the expected internal implementation function makeNoiseImpl(...) to provide its custom logic... Fig 9: # cat.claro
$$newtype InternalState : struct { favoriteInsult: string }
$$
function makeNoiseImpl(cat: State) -> string { # No more code duplication. return unwrap(unwrap(cat).internal).favoriteInsult;
}
$$
$$function create(name: string, favoriteInsult: string) -> State {
$$ return State({
$$ name = name,
$$ internal = InternalState({favoriteInsult = favoriteInsult})
$$ });
$$} ...and again, the "inherited" code can be included in the srcs of BOTH Module declarations... Fig 10: # BUILD
load(":animals.bzl", "Animal") # An example of **LITERALLY** reusing code.
Animal(name = "dog", srcs = ["dog.claro", "default_animal_sounds_impl.claro"])
Animal(name = "cat", srcs = ["cat.claro", "default_animal_sounds_impl.claro"]) Modern software engineering best practices have been progressing towards the consensus view that you should prefer composition over inheritance. But, even though this preference is generally shared by Claro's author, it shouldn't necessarily indicate that inheritance is impossible to achieve. While Claro won't ever add first-class support for inheritance to the language, Claro explicitly leaves these sorts of design decisions to you and provides Build time metaprogramming support to allow the community to encode these sorts of organizational design patterns themselves to be available for whoever decides they have a good reason for it. You shouldn't need to be hostage to the language designer's agreement or prioritization to be able to extend the code organization patterns that can be expressed in the language.

