Arguably, the Animal(...) macro from the previous sections could be described as an encoding of an "Abstract Module" (in a sense vaguely similar to Java's "Abstract Classes" - minus the object-orientation). "Abstract" in the sense that some portions of all "Animal" Modules are known before even knowing the "concrete Animal" Modules that you'll specifically build later on. But there's nothing about this concept itself that's unique to "Animals". All sorts of categories of similar Modules can be imagined, and they could potentially all benefit from a similar "Abstract" base encoding that later gets specialized for each concrete Module. Largely as a draft demonstration of what a standardized encoding of this "Abstract Module" design pattern could look like, Claro provides a claro_abstract_module(...) Bazel Macro. Now, the Animal(...) Macro can be auto-generated in a few lines by simply calling the claro_abstract_module(...) Macro. Fig 1: # animal.bzl
load( "@claro-lang//stdlib/utils/abstract_modules:abstract_module.bzl", "claro_abstract_module",
) Animal = \ claro_abstract_module( name = "Animal", module_api_file = "animal.claro_module_api", overridable_srcs = { "AnimalSoundsImpl": ":default_animal_sounds_impl.claro", "InternalStateAndConstructor": ":default_internal_state.claro", "MakeNoiseImpl": ":default_make_noise_impl.claro", }, default_deps = { "AnimalSounds": ":animal_sounds", }, default_exports = ["AnimalSounds"], )

