mut [*, ***, **, *] with the List Comprehension based alternative: Fig 2: # The `|` below is read either "for" or "given".
var mutList = mut [strings::repeated("*", x) | x in [1, 3, 99, 2, 1] where x <= 10];
print(mutList); Output: mut [*, ***, **, *] As you can see, taking the time to get comfortable with Comprehension expressions can serve to significantly simplify your code. Optional : it may be useful to read a bit about the "Set Builder Notation" that inspires this syntax in both Claro and Python.

