Claro's mutability annotations are shallow by design so that you maintain fine-grained control over creating arbitrarily complex nested data structures that mix mutability and immutability as needed. The following examples demonstrate different combinations of nested mutability annotations: This example demonstrates a mutable list whose elements are immutable lists. Fig 4: var l: mut [[int]] = mut [];
for (i in [1, 2, 3]) { lists::add(l, [i, i]); # <-- Add an immutable list to the mutable list.
}
print(l); Output: [0.001s][warning][perf,memops] Cannot use file /tmp/hsperfdata_runner/6 because it is locked by another process (errno = 11)
mut [[1, 1], [2, 2], [3, 3]] This example demonstrates an immutable list whose elements are mutable lists. Fig 5: var l: [mut [int]] = [mut [], mut [], mut []];
var i = 1;
for (mutList in l) { lists::add(mutList, i); # <-- Append an int to this inner mutable list. lists::add(mutList, i++);
}
print(l); Output: [mut [1, 1], mut [2, 2], mut [3, 3]]

